import React, { useState, useContext } from 'react';
import { UserContext } from "../UserContext";
import * as icons from 'react-icons/fa';
import { Link } from 'react-router-dom';
import * as api from '../library/api';

function Navbar() {
    const User = useContext(UserContext);
    const Logout = () => {
        // api.Post("/authenticate/", details, function (response) {
        //     if (response != null) {
        //         console.log(response)
        //         window.localStorage.setItem('cUser', JSON.stringify(response));
        //         window.location.href = '/';
        //     }
        // });
        (async () => {
            const rawResponse = await fetch('/logout/', {
                method: 'POST',
                headers: {
                    'Accept': 'application/json',
                    'Content-Type': 'application/json'
                }
            });
            const response = await rawResponse.json();
            console.log(response);
            if (response === "LOGGEDOUT") {
                window.localStorage.removeItem("cUser");
                window.location.href = "/";
            }
        })();
    }
    return (
        <>
            <nav className="navbar navbar-expand-lg navbar-absolute">
                <div className="container-fluid">
                    {/* <div className="navbar-wrapper">
                        <div className="navbar-toggle">
                            <button type="button" className="navbar-toggler">
                                <span className="navbar-toggler-bar bar1"></span>
                                <span className="navbar-toggler-bar bar2"></span>
                                <span className="navbar-toggler-bar bar3"></span>
                            </button>
                        </div>
                        <a className="navbar-brand" href="#pablo">Table List</a>
                    </div> */}
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navigation" aria-controls="navigation-index" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-bar navbar-kebab"></span>
                        <span className="navbar-toggler-bar navbar-kebab"></span>
                        <span className="navbar-toggler-bar navbar-kebab"></span>
                    </button>
                    <div className="collapse navbar-collapse justify-content-end" id="navigation">
                        <form>
                            <div className="input-group no-border">
                                <input type="text" value="" className="form-control" placeholder="Search..." />
                                <div className="input-group-append">
                                    <div className="input-group-text">
                                        <i className="now-ui-icons ui-1_zoom-bold"></i>
                                    </div>
                                </div>
                            </div>
                        </form>
                        <ul className="navbar-nav">
                            <li className="nav-item dropdown">
                                <a className="nav-link dropdown-toggle" id="navbarDropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                                    <i className="now-ui-icons users_single-02"></i>
                                    <p>
                                        <span className="d-lg-none d-md-block">User</span>
                                    </p>
                                </a>
                                <div className="dropdown-menu dropdown-menu-right" aria-labelledby="navbarDropdownMenuLink">
                                    <a className="dropdown-item" href="#">Account</a>
                                    <a className="dropdown-item" href="#" onClick={Logout}>Logout</a>
                                </div>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>
        </>
    );
}

export default Navbar;
